import '../../pages/register/style.css';
import { Formik, Form, Field } from 'formik';


export default function Register() {

  function onSubmit(values, actions) {

    console.log('SUBMIT', values);
    
  } 
function validate(values){

  const errors = {};
  if(!values.name){
    errors.name = "Nome é obrigatório!";
  }
  if(!values.email){
    errors.name = "Nome é obrigatório!";
  }
  return errors;
}


  return (
    <div >
      <Formik
        validate={validate}
        onSubmit={onSubmit}
        initialValues={{
          name: '',
          email: '',
          cpf: '',
          crm: '',
          specialization: '',
          phoneOne: '',
          phoneTwo: '',
          password: '',
        }}
        render={({ values,errors }) => (
          <Form>
            <div>
              <label>Nome</label>
              <Field name="name" type="text" />
              {errors.name && (
                <span>{errors.name}</span>
              )}
            </div>
            <div>
              <label>Email</label>
              <Field name="email" type="email" />
              {errors.email && (
                <span>{errors.email}</span>
              )}
            </div>

            <div>
              <label>Cpf</label>
              <Field name="cpf" type="text" />

            </div>
            <div>
              <label>Crm</label>
              <Field name="crm" type="text" />

            </div>
            <div>
              <label>Especialização</label>
              <Field name="specialization" type="text" />

            </div>
            <div>
              <label>Telefone1</label>
              <Field name="phoneOne" type="text" />

            </div>
            <div>
              <label>Telefone2</label>
              <Field name="phoneTwo" type="text" />

            </div>

            <div>
              <label>Senha</label>
              <Field name="password" type="password" />

            </div>
            <button type="submit">Enviar</button>
          </Form>
        )}
      />
    </div>
  );
}
